import React from "react";
import { withStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import { CardActions, CardHeader } from "@material-ui/core";
import Divider from "@material-ui/core/Divider";
import Grid from "@material-ui/core/Grid";
import axios from "axios";
import { connect } from "react-redux";
const styles = theme => ({
  HPSBlue: {
    backgroundColor: "#1C80B5",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "18px",
    margin: theme.spacing.unit,
    color: "#FFFFF"
  },
  default: {
    backgroundColor: "#F0F0F0",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "18px",
    margin: theme.spacing.unit,
    color: "#999794"
  },
  nextButton: {
    margin: theme.spacing.unit * 2,
    backgroundColor: "#1C80B5",
    width: 150,
    height: 50,
    fontSize: "14px",
    color: "#ffffff"
  },
  clearButton: {
    margin: theme.spacing.unit * 2,
    width: 200,
    height: 50,
    fontSize: "14px"
  },
  label: {
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "20px",
    margin: theme.spacing.unit * 2,
    color: "#1C80B5"
  },
  card: {
    maxWidth: 1080
  }
});
class StatesOffExchange extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      al: false,
      ak: false,
      az: false,
      ar: false,
      ca: false,
      co: false,
      ct: false,
      de: false,
      fl: false,
      ga: false,
      hi: false,

      id: false,
      il: false,
      in: false,
      ia: false,
      ks: false,
      ky: false,
      la: false,
      me: false,
      md: false,
      ma: false,
      mi: false,

      mn: false,
      ms: false,
      mo: false,
      mt: false,
      ne: false,
      nv: false,
      nh: false,
      nj: false,
      nm: false,
      ny: false,
      nc: false,

      nd: false,
      oh: false,
      ok: false,
      or: false,
      pa: false,
      ri: false,
      sc: false,
      sd: false,
      tn: false,
      tx: false,
      ut: false,

      vt: false,
      va: false,
      wa: false,
      wv: false,
      ne1: false,
      states: []
    };
  }
  handleSubmit = e => {
    e.preventDefault();
    const post = {
      carrierName: this.props.carrierName,
      carrierCode: this.props.carrierCode,
      businessType: "offExchange",
      states: this.state.states
    };
    console.log(JSON.stringify(post));
    axios
      .post(`http://10.24.46.14:8080/api/allCarriers`, {
        body: JSON.stringify(post)
      })
      .then(function(response) {
        console.log(response);
      });
    if (this.props.offExchange === true)
      this.props.history.push(`/admin/LineOfBusinessOffExchange`);
    else if (this.props.onExchange === true)
      this.props.history.push(`/admin/LineOfBusinessOnExchange`);
    else if (this.props.group === true)
      this.props.history.push(`/admin/LineOfBusinessGroup`);
  };
  changeAL = () => {
    this.setState({ al: !this.state.al });
    const temp = this.state.states;
    var index = temp.indexOf("al");
    if (this.state.al === false) {
      temp.push("al");
      this.setState({ states: temp });
    }
    if (this.state.al === true) {
      temp.splice(index, 1);
      this.setState({ states: temp });
    }
  };
  changeAK = () => {
    this.setState({ ak: !this.state.ak });
    const temp = this.state.states;
    var index = temp.indexOf("ak");
    if (this.state.ak === false) {
      temp.push("ak");
      this.setState({ states: temp });
    }
    if (this.state.ak === true) {
      temp.splice(index, 1);
      this.setState({ states: temp });
    }
